import React, { useState } from 'react';
// import { Routes, Route, Navigate } from 'react-router-dom';
// import Header from './components/Header';
// import Footer from './components/Footer';
// import LandingPage from './pages/LandingPage';
// import MapPage from './pages/MapPage';
// import FarmDetailsPage from './pages/FarmDetailsPage';
// import NotFoundPage from './pages/NotFoundPage';
import './App.css';

// Placeholder components - will be created later
const Home = () => <div>Home Page Content</div>;
const About = () => <div>About Page Content</div>;
const Map = () => <div>Map Component Placeholder</div>;


function App() {
  const [currentPage, setCurrentPage] = useState('home'); // 'home', 'about', 'map'

  const renderPage = () => {
    switch (currentPage) {
      case 'about':
        return <About />;
      case 'map':
        return <Map />;
      case 'home':
      default:
        return <Home />;
    }
  };

  return (
    <div className="app">
      {/* TODO: Add cow image here */}
      <nav>
        {/* TODO: Add Navbar buttons here */}
        <button onClick={() => setCurrentPage('home')}>Home</button>
        <button onClick={() => setCurrentPage('about')}>About</button>
        <button onClick={() => setCurrentPage('map')}>Map</button>
      </nav>
      <main>
        {renderPage()}
      </main>
      {/* Footer removed, can be added back if needed */}
    </div>
  );
}

export default App;
